import React from "react";
import styles from './Profile.module.css';
import MyPosts from "./MyPosts/MyPosts";

const Profile = () => {
    return (
        <div>
         <div>
                <img className={styles.profile__image}
                    src="https://helpx.adobe.com/content/dam/help/en/xd/how-to/create-webpage-header/jcr_content/main-pars/image/create-webpage-header_1000x560.jpg"
                    alt=""
                />
            </div>
           <MyPosts />
        </div>
    );
};

export default Profile;
